import React from 'react'

export default function Home() {
    return (
        <div>
            <h1 className='heading'><center><span style={{color:'red', border:'1rem', borderColor:'black'}}>K</span><span style={{color:'orange'}}>r</span><span style={{color:'yellow'}}>i</span><span style={{color:'green'}}>b</span><span style={{color:'skyblue'}}>b</span><span style={{color:'blue'}}>l</span><span style={{color:'pink'}}>e</span><span style={{color:'purple'}}>.</span><span style={{color:'white'}}>KK</span></center></h1>
        </div>
    )
}
